import React from "react";
import about from "../src/images/about.jpg";

export const About =()=>{
    return(
        <>
        
        <div class="container">
              <img src={about} alt="Snow" style={{width:"100%", height:"50%"}} />
       
     <div >Top Left</div>
  <div>Top Right</div>
  <div >Bottom Right</div>
  <div>Centered</div>
   </div>
        
        </>
    )
    

};

export default About;
